import styles from "../styles/Experience.module.css";
import { Box } from "@mui/material";

const Experience = () => {
  return (
    <div className={styles.all}>
      <h1>Experience</h1>
      <div className={styles.all}>
        <Box className={styles.about_box}>
          <h1>Hi, I'm Sana Merchant!</h1>
        </Box>
      </div>
    </div>
  );
};

export { Experience };
